INSERT INTO `course` VALUES (1,'17/10/2013','\"The Ultimate Drawing Course - Beginner to Advanced\" is a comprehensive and highly acclaimed course designed to take students on a transformative journey from novice to advanced artist. Taught by an experienced instructor, this course covers a wide range of drawing techniques, including line drawing, shading, perspective, composition, figure drawing, still life, and more. With step-by-step instructions, practical exercises, and valuable insights, this course provides a solid foundation and empowers artists to confidently create expressive and impressive drawings at any skill level.','https://img-c.udemycdn.com/course/750x422/874012_c7f2_3.jpg','INTERMEDIATE',100,'The Ultimate Drawing Course - Beginner to Advanced',1,5),(2,'17/10/2013','\"The Art of the Portrait - Drawing For Beginners\" is a beginner-friendly course that delves into the captivating world of portrait drawing, teaching aspiring artists essential techniques and principles to confidently capture the likeness, expressions, and personality of their subjects using a variety of drawing mediums, including pencil, charcoal, and pastels, while also exploring topics such as proportions, anatomy, values, and shading to create stunning and lifelike portraits.','https://res.cloudinary.com/diaixspmb/image/upload/v1698423468/download.jpg.jpg','BEGINNER',90,'The Art of the Portrait - Drawing For Beginners',1,5),(3,'17/10/2013','\"Head Drawing Fundamentals Made Simple\" is a comprehensive course created to demystify the art of drawing heads, taught by an experienced instructor. With an emphasis on simplicity, this course equips artists with the foundational techniques and knowledge required to accurately capture the intricacies of the human head, including proportions, facial features, expressions, and light and shadow, enabling them to create engaging and realistic portraits.','https://res.cloudinary.com/diaixspmb/image/upload/v1698423683/picture1.jpg.jpg','ADVANCED',100,'Head Drawing Fundamentals Made Simple',1,5),(5,'20/10/2023','\"Figure Drawing - The Body in Action\" is a transformative course designed by Robert A. Marzullo, an experienced online instructor and author, aimed at elevating artists\' figure drawing skills by providing a deep understanding of the body\'s movement, rhythm, anatomy, balance, foreshortening, and the interplay of light and shadow, enabling them to create dynamic and lifelike representations of the human figure.','https://res.cloudinary.com/diaixspmb/image/upload/v1698424188/picture2.jpg.jpg','BEGINNER',50,'Figure Drawing - The Body in Action',2,6),(6,'21/10/2023','The \"Human Body Anatomy Drawing - Figure Drawing Course\" is a specialized course focused on teaching artists how to accurately and confidently draw the human figure. Through a combination of anatomy lessons, gesture drawing exercises, and in-depth instruction on proportions, muscles, bones, and various body parts, this course equips artists with the knowledge and skills required to create dynamic and realistic figure drawings. Whether you\'re a beginner or an experienced artist looking to improve your figure drawing abilities, this course provides valuable insights and techniques to bring your drawings to life.','https://res.cloudinary.com/diaixspmb/image/upload/v1698425131/download%20%281%29.jpg.jpg','INTERMEDIATE',60,'Human Body Anatomy Drawing - Figure Drawing Course',2,6),(7,'22/10/2023','The \"Drawing Masterclass: Art, Sketching, Drawing Course\" is a comprehensive and versatile course that offers a broad range of drawing techniques and skills to aspiring artists of all levels. Through a series of instructional videos, demonstrations, and hands-on exercises, this course covers various aspects of drawing, including sketching, shading, perspective, composition, still life, portraiture, landscapes, and more. Taught by experienced instructors, this masterclass provides valuable insights, tips, and tricks to enhance your drawing abilities and cultivate your artistic style. Whether you\'re a beginner or seeking to refine your skills, this course offers a wealth of knowledge to help you excel in the world of drawing.','https://res.cloudinary.com/diaixspmb/image/upload/v1698425248/download%20%282%29.jpg.jpg','ADVANCED',70,'Drawing Masterclass: Art, Sketching, Drawing Course',2,6),(8,'23/10/2023','The \"Environment Art School: Complete Perspective Drawing Course\" is a specialized course that focuses on teaching artists how to effectively incorporate perspective into their environment drawings. By mastering perspective, artists can accurately represent depth, distance, and proportion, creating realistic and immersive environments in their artwork.','https://res.cloudinary.com/diaixspmb/image/upload/v1698425496/download%20%283%29.jpg.jpg','BEGINNER',55,'Environment Art School: Complete Perspective Drawing Course',3,7),(9,'24/10/2023','\"Traveler\'s Urban Sketchbook 2: Drawing Landscapes\" is a specialized course designed to help artists capture the beauty and essence of landscapes through sketching. Building upon the foundational skills from the first volume of the Urban Sketchbook series, this course focuses on techniques specifically tailored for drawing landscapes.','https://res.cloudinary.com/diaixspmb/image/upload/v1698425543/download%20%284%29.jpg.jpg','INTERMEDIATE',65,'Traveler\'s Urban Sketchbook 2: Drawing Landscapes',3,7),(10,'25/10/2023','We\'ve likely all heard of and used coloured pencils, but have you seen them used in way to create beautiful paintings such as these? With this course you will learn the fundamentals behind using coloured pencils in a unique way to create amazing works of art.','https://res.cloudinary.com/diaixspmb/image/upload/v1698425618/download%20%285%29.jpg.jpg','ADVANCED',75,'How to use Coloured Pencils to draw 5 AMAZING Landscapes',3,7),(11,'26/10/2023','The \"Character ART Academy: Complete Character Design Course\" is a comprehensive program designed to help aspiring artists develop the skills and knowledge needed to create captivating and well-designed characters. Whether you\'re a beginner or an intermediate artist, this course provides a structured learning experience to enhance your character design abilities.','https://res.cloudinary.com/diaixspmb/image/upload/v1698425779/download%20%286%29.jpg.jpg','ADVANCED',70,'Character ART Academy: Complete Character Design Course',4,8),(12,'27/10/2023','Figure drawing for cartoon characters is an essential skill for any aspiring cartoonist or character designer. It involves studying and understanding the human form, proportions, and anatomy, and then simplifying and exaggerating those elements to create stylized and appealing cartoon characters. Here\'s a step-by-step guide to figure drawing for cartoon characters','https://res.cloudinary.com/diaixspmb/image/upload/v1698425863/download%20%287%29.jpg.jpg','INTERMEDIATE',80,'Figure drawing for Cartoon Characters',4,8),(13,'20/10/2023','The Manga Drawing Course for Beginners is designed to help those interested in creating manga-style artwork develop the fundamental skills necessary to bring their characters and stories to life. Whether you have little to no drawing experience or want to delve into the world of manga specifically, this course will provide a step-by-step learning experience to help you get started','https://res.cloudinary.com/diaixspmb/image/upload/v1698425962/download%20%288%29.jpg.jpg','ADVANCED',90,'Manga Drawing Course for Beginners',5,9),(14,'20/10/2023','mangAnimeおひさま塾 is a specialized program that offers aspiring artists the opportunity to learn manga drawing directly from a Japanese animator. If you have a strong interest in manga and anime and want to learn from an industry professional, this course could be a great fit for you','https://res.cloudinary.com/diaixspmb/image/upload/v1698426064/download%20%289%29.jpg.jpg','BEGINNER',75,'mangAnimeおひさま塾: Learn Manga Drawing from Japanese Animator',5,9),(17,'28/10/2023','Ultimate Beginners Cartooning Course: Basic Characters is a comprehensive course designed for anyone interested in learning the art of cartooning. Whether you have no prior drawing experience or you\'re already familiar with the basics, this course will take you through a step-by-step process to help you create your own unique cartoon characters.','https://res.cloudinary.com/diaixspmb/image/upload/v1699629043/download%20%2811%29.jpg.jpg','BEGINNER',65,'Ultimate Beginners Cartooning Course : Basic Characters',4,8),(18,'29/10/2023','MangAnimeおひさま塾: Learn Manga Drawing from Jap Manga Artist ② is an immersive and in-depth course designed specifically for individuals who are passionate about manga and want to take their drawing skills to the next level. Taught by a highly experienced and talented Japanese manga artist, this course offers a unique opportunity to learn the intricacies of manga art directly from a professional within the industry.','https://res.cloudinary.com/diaixspmb/image/upload/v1699629061/download%20%2812%29.jpg.jpg','INTERMEDIATE',70,'mangAnimeおひさま塾: Learn Manga Drawing from Jap Manga Artist ②',5,9),(19,'30/10/2023','Subjects with Pen and Ink is a comprehensive and engaging course that explores the world of pen and ink drawing, teaching you a variety of techniques and methods to create stunning and expressive artwork. Whether you are a beginner or have some experience with pen and ink, this course will provide you with the tools and knowledge to take your skills to new heights.','https://res.cloudinary.com/diaixspmb/image/upload/v1699629078/download%20%2813%29.jpg.jpg','BEGINNER',70,'Subjects with Pen and Ink',6,10),(20,'30/10/2023','The Pen and Ink Experience is an immersive and transformative course that takes you on a creative journey through the world of pen and ink drawing. Designed for artists of all levels, this course goes beyond technical skill-building and provides a holistic approach to the art of pen and ink.','https://res.cloudinary.com/diaixspmb/image/upload/v1699629088/download%20%2814%29.jpg.jpg','INTERMEDIATE',85,'The Pen and Ink Experience',6,10),(21,'30/10/2023','The Complete Drawing Course: Ultimate Drawing Art with Pencil is a comprehensive and in-depth course designed to take aspiring artists on a journey of mastering the art of drawing with pencils. Whether you\'re a beginner or have some experience, this course will provide you with a solid foundation and advanced techniques to create stunning and realistic pencil drawings.','https://res.cloudinary.com/diaixspmb/image/upload/v1699629098/download%20%2815%29.jpg.jpg','ADVANCED',90,'Complete Drawing Course: Ultimate Drawing Art with Pencil',6,10),(27,'14/11/2023','son','https://res.cloudinary.com/diaixspmb/image/upload/v1698425248/download%20%282%29.jpg.jpg','BEGINNER',45,'son',1,5);
